import React from 'react';
import { Link } from "react-router-dom";
import logo from '../assets/shared/logo.svg'



export default function Navbar() {
  return (
        <nav className='flex bg-transparent items-center justify-between fixed mt-10 pl-10 text-white'>
                <div className='px-20'>
                    <img src={logo} alt="logo" />
                </div>
                <span className='h-1 opacity-70 w-96 bg-slate-600'></span>
            
                <ul className='flex gap-10 pl-10 mr-0'>
                    <Link to='/' className='navitem'><span className='font-bold'>00</span>HOME</Link>
                    <Link to='/destination' className='navitem' ><span className='font-bold'>01</span>DESTINATION</Link>
                    <Link to='/crew' className='navitem'><span className='font-bold'>02</span>CREW</Link>
                    <Link to='/technology' className='navitem'><span className='font-bold'>03</span>TECHNOLOGY</Link>
                </ul>
           
        </nav>
  )
}
